import React from 'react'
import Detail from '../../../front/Detail/Detail'
import Mouse from './assets/mouse.png'

function Props() {


    return (
        <div>
            <Detail image={Mouse} nama='Mouse' stock='600' />
        </div>
    );
}

export default Props;
